import Api from '../Apit.json'
import ChargerList from './ChargerList';
const Charger = (props) => {
      console.log(props)
      let charge = [];

      console.log(props.MyLat + 0.1)
      console.log(Api.item[1].lat)
      console.log(props.MyLat - 0.1)
      console.log(props.MyLng + 0.1)
      console.log(Api.item[1].lng)
      console.log(props.MyLng - 0.1)
      for(let i in Api.item){
        if((props.MyLat + 0.1) > Api.item[i].lat && Api.item[i].lat > (props.MyLat - 0.1)){
          if((props.MyLng + 0.1) > Api.item[i].lng && Api.item[i].lng > (props.MyLng - 0.1)){
            console.log("리스트2")
            charge[i] = <ChargerList
            key={i}
            lat={Api.item[i].lat}
            lng={Api.item[i].lng}
            title={Api.item[i].statNm}
            addr={Api.item[i].addr}
            useTime={Api.item[i].useTime}
            stat={Api.item[i].stat}
            chgerType={Api.item[i].chgerType}
            setLat={props.setLat} 
            setLng={props.setLng}
            />
          }
        }
      }
  return charge
}

export default Charger
